import { useState } from "react";
import "./styles/Login.css"

const LoginComponent = () => {

    const [login, setLogin] = useState("");
    const [password, setPassword] = useState("");

    return ( 
        <>
            <form className="login-form">
                <label htmlFor="loginInput"> Логин: </label>
                <input type="text" id="loginInput" placeholder="введите ваш логин" onChange={(e) => {setLogin(e.target.value)}} value={login} required/>
                <label htmlFor="loginInput"> Логин: </label>
                <input type="password" id="loginInput" placeholder="введите ваш логин" onChange={(e) => {setPassword(e.target.value)}} value={password} required></input>
                <button>Войти</button>
            </form>
        </>
     );
}

export default LoginComponent;
